import 'ol/ol.css';
import 'ol-layerswitcher/src/ol-layerswitcher.css';

import Map from 'ol/Map';
import View from 'ol/View';
import LayerGroup from 'ol/layer/Group';
import LayerTile from 'ol/layer/Tile';
import BaseLayer from 'ol/layer/Base';
import SourceOSM from 'ol/source/OSM';
import TileWMS from 'ol/source/TileWMS';
import LayerSwitcher from 'ol-layerswitcher';
import XYZ from 'ol/source/XYZ';
import proj4 from 'proj4';
import { get as getProjection } from 'ol/proj';
import { register } from 'ol/proj/proj4';

import { defaults } from 'olgm/interaction'
import GoogleLayer from 'olgm/layer/Google.js';
import OLGoogleMaps from 'olgm/OLGoogleMaps.js';





proj4.defs('EPSG:3395', '+proj=merc +lon_0=0 +k=1 +x_0=0 +y_0=0 +datum=WGS84 +units=m +no_defs');
register(proj4);
var proj27700 = getProjection('EPSG:3395');
proj27700.setExtent([-20037508.342789244, -20037508.342789244, 20037508.342789244, 20037508.342789244]);

var map = new Map({
    target: 'map',
    layers: [

        new GoogleLayer({
            title: "Google Physical",
            type: 'base',
            mapTypeId: google.maps.MapTypeId.TERRAIN
        }
        ),
        new GoogleLayer({
            title: "Google Streets", // the default
            type: 'base',
            numZoomLevels: 20
        }
        ),
        new GoogleLayer({
            title: "Google Hybrid",
            type: 'base',
            mapTypeId: google.maps.MapTypeId.HYBRID
        }
        ),
        new GoogleLayer({
            title: "Google Satellite",
            type: 'base',
            mapTypeId: google.maps.MapTypeId.SATELLITE,
        }
        ),
        new LayerTile({
            title: 'Yandex',
            type: 'base',
            visible: true,
            source: new XYZ({
                url: 'http://vec01.maps.yandex.net/tiles?l=map&x={x}&y={y}&z={z}',
                projection: 'EPSG:3395',

            })
        }),
        new LayerTile({
            title: 'OpenStreetMap',
            type: 'base',
            visible: true,
            source: new SourceOSM(),
        }),

        /*  new LayerGroup({
               'title': 'Base maps',
               layers: [

                    new LayerTile({
                        title: 'OpenStreetMap',
                        type: 'base',
                        visible: true,
                        source: new SourceOSM(),
                    }),
                   new LayerTile({
                       title: 'Google Satelite',
                       type: 'base',
                       visible: true,
                       source: new XYZ({
                           url: 'http://mt0.google.com/vt/lyrs=s&hl=en&x={x}&y={y}&z={z}'
                       })
                   }),
                   new LayerTile({
                       title: 'Google Street',
                       type: 'base',
                       visible: true,
                       source: new XYZ({
                           url: 'http://mt0.google.com/vt/lyrs=m&hl=en&x={x}&y={y}&z={z}'
                       })
                   }),
                   new LayerTile({
                       title: 'Google Hybrid',
                       type: 'base',
                       visible: true,
                       source: new XYZ({
                           url: 'http://mt0.google.com/vt/lyrs=y&hl=en&x={x}&y={y}&z={z}'
                       })
                   }),
                   new LayerTile({
                       title: 'Yandex',
                       type: 'base',
                       visible: true,
                       source: new XYZ({
                           url: 'http://vec01.maps.yandex.net/tiles?l=map&x={x}&y={y}&z={z}',
                           projection: 'EPSG:3395',

                       })
                   }),

               ],
           }),*/
        new LayerGroup({
            title: 'Overlays',
            layers: [
                new LayerTile({
                    title: 'Granica',
                    source: new TileWMS({
                        url: 'http://localhost:8080/geoserver/wms',
                        params: { 'LAYERS': 'web_map:drzava', 'TILED': true },
                        serverType: 'geoserver',
                        transition: 0,
                    })
                }),
                new LayerTile({
                    title: 'Hidroelektrane',
                    source: new TileWMS({
                        url: 'http://localhost:8080/geoserver/wms',
                        params: { 'LAYERS': 'web_map:eco_os_hidroelektrane', 'TILED': true },
                        serverType: 'geoserver',
                        transition: 0
                    })
                }),
                new LayerTile({
                    title: 'Pruga',
                    source: new TileWMS({
                        url: 'http://localhost:8080/geoserver/wms',
                        params: { 'LAYERS': 'web_map:eco_os_pruga1', 'TILED': true },
                        serverType: 'geoserver',
                        transition: 0,
                    })
                }),
                new LayerTile({
                    title: 'Cenej',
                    transparent: true,
                    className: 'cenej',
                    source: new TileWMS({
                        url: 'http://localhost:8080/geoserver/wms',
                        params: { 'LAYERS': 'cite:G_POLYGON', 'TILED': true },
                        serverType: 'geoserver',
                        transition: 0,
                    })
                }),

            ]
        }),

    ],
    view: new View({
        center: [2281953.166686316, 5591123.972427968],
        zoom: 7
    })
});

map.on('click', function (e) {
    console.log(e);
})

var olGM = new OLGoogleMaps({ map: map });
olGM.activate();

var layerSwitcher = new LayerSwitcher();
map.addControl(layerSwitcher);
